import './MiddleContent.css'

class MiddleContent extends Component {
    render() {
        return (
            <div id="middleContent" className="col-12 text-center">
                <h1 className="txtFont txt-Col"> Our   Specialization</h1>
            </div>
        )
    }
}

export default MiddleContent
